svg.script:
       function update_clock(){
       var t = new Date();
        var min=t.getMinutes();
        var hour=t.getHours();
	var sec = t.getSeconds();
	
	/* 15 degrees = 360/24
	   6 degrees  = 360/60
	   0.1 degrees = 360/60/60
	   0.25 deg   = 360/24/60
	*/
	
        var hour_deg = 15 * ((hour+12) % 24) + 0.25 * min + (0.25/60) * sec;
        var min_deg = 6 * min + 0.1 * sec;
        document.getElementById('hour_hand_rot').setAttribute('transform', 'rotate('+hour_deg+')');
        document.getElementById('min_hand_rot').setAttribute('transform', 'rotate('+min_deg+')');
	window.setTimeout(update_clock, 15000);
        }
